CREATE DEFINER=`root`@`localhost` PROCEDURE `customer_workin_company`(in _company_id int
                                           ,in _customer_code varchar(50)
                                           ,in _from_date varchar(50)
)
BEGIN
    declare cus_code varchar(50);
    declare com_id int;
    declare f_date varchar(50);
    declare t_id int;
    
    select `customer_code`, `company_rid`, `from_date`, `id` into cus_code, com_id, f_date, t_id 
    from Company_has_Customer 
    where `to_date` = '99-9999' and `customer_code` = _customer_code 
    limit 1;
    
    If cus_code = _customer_code then
        select 'FAILURE' as result;
        select cus_code, com_id, f_date, t_id;
    else
        insert into company_has_customer(`company_rid`, `customer_code`, `from_date`) values(_company_id, _customer_code, _from_date);
        update Customer set type_of_insurance = 'COMPULSORY' where `code` = _customer_code;
        select 'SUCCESS' as result;
    end if;
END ;;
